    setUsersList((prevUsersList)=>{
return[...prevUsersList, {name: uName,age: uAge,id: Math.random() }];
    });
  };
  return (


    <div>
      <AddUser onAddUser ={addUserHandler}>
        <UsersList users={usersList}></UsersList>
      </AddUser>
